import React from 'react'
import './Partner.css';
import Marquee from "react-fast-marquee";

function Partner() {
  return (
    <div className='partner-container'>
      <h1 className='partner-h1'>Not a student? Partner with us to grow your reach!</h1>
      <div className='companies'>
        <Marquee pauseOnHover={true} speed={50} gradientColor={[248,251,253]}
        gradientWidth={180}>
          <img src='images/sgn.jpg' alt='sgn' className='sgn'/>
          <img src='images/vsc.jpeg' alt='vsc' className='sgn' />
          <img src='images/majulah.jpg' alt='ms' className='sgn' />
          <img src='images/tmlogo.png' alt='tm' className='sgn' />
          <img src='images/mcbc.jpg' alt='mcbc' className='sgn'/>
          <img src='images/bc.jpg' alt='ms' className='sgn' />
          <img src='images/rpr.png' alt='rpr' className='sgn' />
          <img src='images/yeo.png' alt='yeo' className='sgn' />
          <img src='images/pb.png' alt='pb' className='sgn' />
          <img src='images/rr.png' alt='rr' className='sgn' />
          <img src='images/bl.jpeg' alt='bl' className='sgn' />
          <img src='images/nysm.png' alt='nysm' className='sgn' />
        </Marquee>
        </div>
    </div>
  );
}

export default Partner;
